import React from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";
import Card from "pnnl-react-core/lib/Card";
import Grid from "react-bootstrap/es/Grid";
import ResultsTable from "./ResultsTable";
import LcsGraph from "./LcsGraph";
import ModalImage from "react-modal-image";

var tm30_data;

class Report extends React.Component {
  render() {
    return (
      <Grid>
        <h1>Report Page</h1>
        <br />
        {!(this.props.location.state == null) ? (
          <div class="inline">
            {
              // <ResultsTable data={this.props.location.state.data} />
            }
          </div>
        ) : (
          <Card>
            <h2>No data Calculated</h2>
            <h5>
              <ol>
                <li>Click on Calculator above</li> <br />
                <li>Choose which way to calculate data</li> <br />
                <li>Click Calculate and you will be redirected here</li>
              </ol>
            </h5>
          </Card>
        )}
        {!(this.props.location.state == null) ? (
          <p>
            {console.log(this.props.location.state.data.tm30)}
            CCT Test ={" "}
            {this.props.location.state.data.tm30.Numerical_Results.CCT[0]}
            &nbsp;&nbsp;&nbsp;&nbsp; CCT Ref ={" "}
            {this.props.location.state.data.tm30.Numerical_Results.CCT[1]}
            <br />
            DUV Test =
            {this.props.location.state.data.tm30.Numerical_Results.DUV[0]}
            &nbsp;&nbsp;&nbsp;&nbsp; DUV Ref =
            {this.props.location.state.data.tm30.Numerical_Results.DUV[1]}
            <br />
            LER Test ={" "}
            {this.props.location.state.data.tm30.Numerical_Results.LER[0]}
            &nbsp;&nbsp;&nbsp;&nbsp; LER Ref ={" "}
            {this.props.location.state.data.tm30.Numerical_Results.LER[1]}
            <br />x Test ={" "}
            {this.props.location.state.data.tm30.Numerical_Results.x[0]}
            &nbsp;&nbsp;&nbsp;&nbsp;x Ref ={" "}
            {this.props.location.state.data.tm30.Numerical_Results.x[1]}
            <br />y Test ={" "}
            {this.props.location.state.data.tm30.Numerical_Results.y[0]}
            &nbsp;&nbsp;&nbsp;&nbsp;y Ref ={" "}
            {this.props.location.state.data.tm30.Numerical_Results.y[1]}
            <br />u Test ={" "}
            {this.props.location.state.data.tm30.Numerical_Results.u[0]}
            &nbsp;&nbsp;&nbsp;&nbsp;u Ref ={" "}
            {this.props.location.state.data.tm30.Numerical_Results.u[1]}
            <br />v Test ={" "}
            {this.props.location.state.data.tm30.Numerical_Results.v[0]}
            &nbsp;&nbsp;&nbsp;&nbsp;v Ref ={" "}
            {this.props.location.state.data.tm30.Numerical_Results.v[1]}
          </p>
        ) : (
          /*
          <div class="reportImage">
            <ModalImage
              small="http://localhost:8000/tm30_output.png"
              large="http://localhost:8000/tm30_output.png"
              alt=""
            />
          </div>
        */
          <div></div>
        )}
      </Grid>
    );
  }
}

export default Report;
